const input = runtimeScene._runtimeGame.getInputManager()
const player = runtimeScene.getObjects("Player").find((o) => o.player_id === runtimeScene.player_id)
const SPACEBAR = 32;
const LEFTKEY = 37;
const UPKEY = 38
const RIGHTKEY = 39
const DOWNKEY = 40

if(typeof player === "undefined") {
    return;
}

const movementSpeed = 0.33 * runtimeScene.getTimeManager().getElapsedTime()

let x = player.getX()
let y = player.getY()
let z = player.getZOrder()
let moved = false;
var update;

if(input.wasKeyReleased(SPACEBAR)){
    moved = true
    update = {
        command : "SPACEBAR",
        player_id : runtimeScene.player_id,
        data: {
            x : x,
            y : y,
            z : z
        }
    }
}

if(input.isKeyPressed(LEFTKEY)) {
    moved = true
    x -= movementSpeed

    update = {
        command: "MOVEMENT_LEFT",
        player_id: runtimeScene.player_id,
        data: {
            x : x,
            y : y,
            z : z
        }
    }
}

if(input.isKeyPressed(RIGHTKEY)) {
    moved = true;
    x += movementSpeed

    update = {
        command: "MOVEMENT_RIGHT",
        player_id: runtimeScene.player_id,
        data: {
            x : x,
            y : y,
            z : z
        }
    }
}

if(input.isKeyPressed(UPKEY)) {
    moved = true
    y -= movementSpeed

    update = {
        command: "MOVEMENT_UP",
        player_id: runtimeScene.player_id,
        data: {
            x : x,
            y : y,
            z : z
        }
    }
}

if(input.isKeyPressed(DOWNKEY)) {
    moved = true;
    y += movementSpeed

    update = {
        command: "MOVEMENT_DOWN",
        player_id: runtimeScene.player_id,
        data: {
            x : x,
            y : y,
            z : z
        }
    }
}


if(input.wasKeyReleased(LEFTKEY)) {
    moved = true

    update = {
        command: "RELEASED_LEFT",
        player_id: runtimeScene.player_id,
        data: {
            x : x,
            y : y,
            z : z
        }
    }
}

if(input.wasKeyReleased(RIGHTKEY)) {
    moved = true

    update = {
        command: "RELEASED_RIGHT",
        player_id: runtimeScene.player_id,
        data: {
            x : x,
            y : y,
            z : z
        }
    }
}

if(input.wasKeyReleased(UPKEY)) {
    moved = true

    update = {
        command: "RELEASED_UP",
        player_id: runtimeScene.player_id,
        data: {
            x : x,
            y : y,
            z : z
        }
    }
}

if(input.wasKeyReleased(DOWNKEY)) {
